import "./App.css";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import IndexPage from "./Pages/Index";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={IndexPage} />
      </Switch>
    </Router>
  );
}

export default App;
